//                        text = "~ \U041a\U0440\U0430\U0441\U043e\U0442\U0430, \U0436\U0438\U0432\U0443\U0449\U0430\U044f \U0432 \U0444\U0430\U0440\U0444\U043e\U0440\U0435 ~\n\n\U041e\U0441\U043d\U043e\U0432\U0430\U0442\U0435\U043b\U044c \U0438 \U043f\U0440\U0435\U0437\U0438\U0434\U0435\U043d\U0442 \U043a\U043e\U043c\U043f\U0430\U043d\U0438\U0438 ''Franz Porcelain'' \U0424\U0440\U044d\U043d\U0441\U0438\U0441 \U0427\U0435\U043d \U043f\U043e\U0441\U0432\U044f\U0442\U0438\U043b \U0441\U0432\U043e\U044e \U0436\U0438\U0437\U043d\U044c \U0444\U0430\U0440\U0444\U043e\U0440\U0443. \U0415\U0433\U043e \U0444\U0430\U0440\U0444\U043e\U0440 \U043f\U0440\U0438\U0437\U043d\U0430\U043d \U0432\U043e \U0432\U0441\U0435\U043c \U043c\U0438\U0440\U0435, \U044d\U0442\U043e \U0431\U0440\U0435\U043d\U0434, \U0432\U043e\U043f\U043b\U043e\U0442\U0438\U0432\U0448\U0438\U0439 \U0432 \U0441\U0435\U0431\U044f \U0432\U0441\U044e \U043c\U043e\U0449\U044c, \U043a\U0440\U0430\U0441\U043e\U0442\U0443 \U0438 \U0438\U0437\U044b\U0441\U043a\U0430\U043d\U043d\U043e\U0441\U0442\U044c \U0438\U0441\U043a\U0443\U0441\U0441\U0442\U0432\U0430 \U043a\U0438\U0442\U0430\U0439\U0441\U043a\U043e\U0433\U043e \U0444\U0430\U0440\U0444\U043e\U0440\U0430. \U0422\U0432\U043e\U0440\U0435\U043d\U0438\U044f 'Franz Porcelain'' \U0431\U044b\U043b\U0438 \U043e\U0442\U043c\U0435\U0447\U0435\U043d\U044b \U043c\U043d\U043e\U0433\U043e\U0447\U0438\U0441\U043b\U0435\U043d\U043d\U044b\U043c\U0438 \U043d\U0430\U0433\U0440\U0430\U0434\U0430\U043c\U0438 \U043f\U043e \U0432\U0441\U0435\U043c\U0443 \U043c\U0438\U0440\U0443.\n\n\U0421\U0432\U043e\U0435 \U043f\U0440\U043e\U0437\U0432\U0438\U0449\U0435 \"Franz\" [\U0441\U0432\U043e\U0431\U043e\U0434\U043d\U044b\U0439, \U0442\U0432\U043e\U0440\U0447\U0435\U0441\U043a\U0438\U0439 \U0447\U0435\U043b\U043e\U0432\U0435\U043a] \U0427\U0435\U043d \U043f\U043e\U043b\U0443\U0447\U0438\U043b \U0435\U0449\U0435 \U0432 \U0443\U043d\U0438\U0432\U0435\U0440\U0441\U0438\U0442\U0435\U0442\U0435 \U043e\U0442 \U043f\U0440\U043e\U0444\U0435\U0441\U0441\U043e\U0440\U0430 \U043d\U0435\U043c\U0435\U0446\U043a\U043e\U0439 \U043b\U0438\U0442\U0435\U0440\U0430\U0442\U0443\U0440\U044b. \U0417\U0430 \U0433\U043e\U0434\U044b \U043e\U0431\U0443\U0447\U0435\U043d\U0438\U044f \U0432 \U0443\U043d\U0438\U0432\U0435\U0440\U0441\U0438\U0442\U0435\U0442\U0435 \U0424\U0440\U044d\U043d\U0441\U0438\U0441 \U043f\U0440\U0438\U0448\U0435\U043b \U043a \U0432\U044b\U0432\U043e\U0434\U0443, \U0447\U0442\U043e \U0432\U0441\U0435 \U043c\U0438\U0440\U043e\U0432\U044b\U0435 \U043b\U0438\U0434\U0435\U0440\U044b \U0432 \U043e\U0431\U043b\U0430\U0441\U0442\U0438 \U043f\U0440\U043e\U0438\U0437\U0432\U043e\U0434\U0441\U0442\U0432\U0430 \U0444\U0430\U0440\U0444\U043e\U0440\U0430 \U0441\U043e\U0441\U0440\U0435\U0434\U043e\U0442\U043e\U0447\U0435\U043d\U044b \U0432 \U0415\U0432\U0440\U043e\U043f\U0435. \U0418 \U0432\U043e\U0437\U043d\U0430\U043c\U0435\U0440\U0438\U043b\U0441\U044f \U0432\U043e\U0441\U0441\U0442\U0430\U043d\U043e\U0432\U0438\U0442\U044c \U0434\U0440\U0435\U0432\U043d\U044e\U044e \U0441\U043b\U0430\U0432\U0443 \U043a\U0438\U0442\U0430\U0439\U0441\U043a\U043e\U0433\U043e \U0444\U0430\U0440\U0444\U043e\U0440\U0430, \U0441\U043e\U0437\U0434\U0430\U0432 \U0441\U0442\U0438\U043b\U044c, \U043a\U043e\U0442\U043e\U0440\U044b\U0439 \U0441\U043e\U0435\U0434\U0438\U043d\U044f\U0435\U0442 \U044d\U043b\U0435\U043c\U0435\U043d\U0442\U044b \U00abArt Nouveau\U00bb \U0441 \U0438\U0437\U044f\U0449\U043d\U044b\U043c \U0430\U0437\U0438\U0430\U0442\U0441\U043a\U0438\U043c \U0434\U0443\U0445\U043e\U043c.\n\n\U041a\U0430\U0436\U0434\U043e\U0435 \U0438\U0437\U0434\U0435\U043b\U0438\U0435 ''Franz Collection'' \U043e\U0442\U043e\U0431\U0440\U0430\U0436\U0430\U0435\U0442 \U043a\U0440\U0430\U0441\U043e\U0442\U0443, \U043d\U0430\U0439\U0434\U0435\U043d\U043d\U0443\U044e \U0432 \U043f\U0440\U0438\U0440\U043e\U0434\U0435. \U041c\U043d\U043e\U0433\U043e\U0441\U0442\U0443\U043f\U0435\U043d\U0447\U0430\U0442\U0430\U044f \U043e\U0431\U0440\U0430\U0431\U043e\U0442\U043a\U0430 \U0438 \U0440\U0443\U0447\U043d\U0430\U044f \U043f\U043e\U0434\U0433\U043b\U0430\U0437\U0443\U0440\U043d\U0430\U044f \U0440\U043e\U0441\U043f\U0438\U0441\U044c \U043e\U0431\U0435\U0441\U043f\U0435\U0447\U0438\U0432\U0430\U044e\U0442 \U043f\U0440\U043e\U0447\U043d\U043e\U0441\U0442\U044c \U043f\U0440\U0435\U0434\U043c\U0435\U0442\U0430\U043c \U043a\U043e\U043b\U043b\U0435\U043a\U0446\U0438\U0438, \U0430 \U0438\U043d\U0442\U0435\U0440\U0435\U0441\U043d\U044b\U0439 \U0434\U0438\U0437\U0430\U0439\U043d \U0434\U0435\U043b\U0430\U0435\U0442 \U0444\U0430\U0440\U0444\U043e\U0440 ''Franz Porcelain'' \U0438\U0441\U0442\U0438\U043d\U043d\U044b\U043c \U0448\U0435\U0434\U0435\U0432\U0440\U043e\U043c. \U041d\U0430 \U043a\U0430\U0436\U0434\U043e\U043c \U0438\U0437\U0434\U0435\U043b\U0438\U0438 \U0441\U0442\U043e\U0438\U0442 \U0442\U043e\U0440\U0433\U043e\U0432\U044b\U0439 \U0437\U043d\U0430\U043a \U2014 \U0438\U0437\U043e\U0431\U0440\U0430\U0436\U0435\U043d\U0438\U0435 \U0447\U0430\U0439\U043a\U0438, \U0441\U0438\U043c\U0432\U043e\U043b\U0438\U0437\U0438\U0440\U0443\U044e\U0449\U0435\U0435 \U0441\U0432\U043e\U0431\U043e\U0434\U043d\U044b\U0439 \U0442\U0432\U043e\U0440\U0447\U0435\U0441\U043a\U0438\U0439 \U043f\U043e\U0442\U0435\U043d\U0446\U0438\U0430\U043b.\n\n\U041a\U043e\U043c\U043f\U0430\U043d\U0438\U044f ''Franz Collection'' \U0437\U043d\U0430\U0435\U0442, \U043a\U0430\U043a \U0437\U0430\U0441\U0442\U0430\U0432\U0438\U0442\U044c \U0442\U0440\U0435\U043f\U0435\U0442\U0430\U0442\U044c \U0436\U0435\U043d\U0441\U043a\U0438\U0435 \U0441\U0435\U0440\U0434\U0446\U0430! \U0423\U043a\U0440\U0430\U0448\U0435\U043d\U0438\U044f \U0438\U0437 \U0444\U0430\U0440\U0444\U043e\U0440\U0430 \U044d\U0442\U043e\U0439 \U043c\U0430\U0440\U043a\U0438 \U043d\U0435 \U043c\U0435\U043d\U0435\U0435 \U0436\U0435\U043b\U0430\U043d\U043d\U044b.\n\n#\U043a\U0438\U0442\U0430\U0439#\U0443\U043a\U0440\U0430\U0448\U0435\U043d\U0438\U044f#\U0444\U0430\U0440\U0444\